void ODEs_odin_with_2_groups_output(ODEs_odin_with_2_groups_pars *ODEs_odin_with_2_groups_p, double t, double *state, double *output) {
  double *S0 = state + 0;
  double *S1a = state + ODEs_odin_with_2_groups_p->offset_S1a;
  double *S1b = state + ODEs_odin_with_2_groups_p->offset_S1b;
  double *S1c = state + ODEs_odin_with_2_groups_p->offset_S1c;
  double *I01 = state + ODEs_odin_with_2_groups_p->offset_I01;
  double *I11 = state + ODEs_odin_with_2_groups_p->offset_I11;
  double *I02 = state + ODEs_odin_with_2_groups_p->offset_I02;
  double *I03 = state + ODEs_odin_with_2_groups_p->offset_I03;
  double *I04 = state + ODEs_odin_with_2_groups_p->offset_I04;
  double *I05 = state + ODEs_odin_with_2_groups_p->offset_I05;
  double *I22 = state + ODEs_odin_with_2_groups_p->offset_I22;
  double *I23 = state + ODEs_odin_with_2_groups_p->offset_I23;
  double *I24 = state + ODEs_odin_with_2_groups_p->offset_I24;
  double *I25 = state + ODEs_odin_with_2_groups_p->offset_I25;
  double *I32 = state + ODEs_odin_with_2_groups_p->offset_I32;
  double *I33 = state + ODEs_odin_with_2_groups_p->offset_I33;
  double *I34 = state + ODEs_odin_with_2_groups_p->offset_I34;
  double *I35 = state + ODEs_odin_with_2_groups_p->offset_I35;
  double *I42 = state + ODEs_odin_with_2_groups_p->offset_I42;
  double *I43 = state + ODEs_odin_with_2_groups_p->offset_I43;
  double *I44 = state + ODEs_odin_with_2_groups_p->offset_I44;
  double *I45 = state + ODEs_odin_with_2_groups_p->offset_I45;
  for (int i = 0; i < ODEs_odin_with_2_groups_p->dim_N; ++i) {
    ODEs_odin_with_2_groups_p->N[i] = S0[i] + S1a[i] + S1b[i] + S1c[i] + I01[i] + I11[i] + I02[i] + I03[i] + I04[i] + I05[i] + I22[i] + I23[i] + I24[i] + I25[i] + I32[i] + I33[i] + I34[i] + I35[i] + I42[i] + I43[i] + I44[i] + I45[i];
  }
  double new_people = ODEs_odin_with_2_groups_p->epsilon * odin_sum1(ODEs_odin_with_2_groups_p->N, 0, ODEs_odin_with_2_groups_p->dim_N - 1);
  double B = (ODEs_odin_with_2_groups_p->c[1] * ODEs_odin_with_2_groups_p->N[1]) / (ODEs_odin_with_2_groups_p->c[0] * ODEs_odin_with_2_groups_p->N[0]);
  double c1_new = ODEs_odin_with_2_groups_p->c[0] * pow(B, ODEs_odin_with_2_groups_p->theta);
  double c2_new = ODEs_odin_with_2_groups_p->c[1] * pow(B, (-(1 - ODEs_odin_with_2_groups_p->theta)));
  double B_check = (c2_new * ODEs_odin_with_2_groups_p->N[1]) / (c1_new * ODEs_odin_with_2_groups_p->N[0]);
  double Ntot = odin_sum1(ODEs_odin_with_2_groups_p->N, 0, ODEs_odin_with_2_groups_p->dim_N - 1);
  output[0] = Ntot;
  output[1] = new_people;
  output[2] = B_check;
}

